package LeetCode;

import java.util.LinkedHashMap;
import java.util.Map;

public class RansomNote383 {

    public static boolean canConstruct(String ransomNote, String magazine) {
        Map<String, Integer> ransomNoteMap = new LinkedHashMap<>();
        Map<String, Integer> magazineMap = new LinkedHashMap<>();
        Integer ransomNoteCounter = 0, magazineCounter = 0;

        for (int i = 0; i < magazine.length(); i++) {
            if (i < ransomNote.length()){
                if(ransomNoteMap.containsKey(ransomNote.substring(i, i+1))){
                    Integer counter = ransomNoteMap.get(ransomNote.substring(i, i+1));

                    ransomNoteMap.put(ransomNote.substring(i, i+1), ++counter);
                }
                else
                    ransomNoteMap.put(ransomNote.substring(i, i+1), 1);

            }

            if (magazineMap.containsKey(magazine.substring(i, i+1))){
                Integer counter = magazineMap.get(magazine.substring(i, i+1));

                magazineMap.put(magazine.substring(i, i+1), ++counter);
            }
            else
                magazineMap.put(magazine.substring(i, i+1), 1);

        }

        for (int i = 0; i < ransomNote.length(); i++) {
            if (!magazineMap.containsKey(ransomNote.substring(i, i+1)))
                return false;
            
            else {
                ransomNoteCounter = ransomNoteMap.get(ransomNote.substring(i, i+1));
                magazineCounter = magazineMap.get(ransomNote.substring(i, i+1));
                boolean output = magazineCounter >= ransomNoteCounter ? true : false;

                if (output == false)
                    return false;
            }
        }

        return true;
    }

    public static void main(String[] args) {

        System.out.println(canConstruct("itwqbtcdprfsuprkrjkausiterybzncbmdvkgljxuekizvaivszowqtmrttiihervpncztuoljftlxybpgwnjb",
                ""));
        // false
        System.out.println(canConstruct("bg", "efjbdfbdgfjhhaiigfhbaejahgfbbgbjagbddfgdiaigdadhcfcj")); // true
        System.out.println(canConstruct("a", "b")); // false
        System.out.println(canConstruct("aa", "ab")); // false
        System.out.println(canConstruct("ab", "ab")); // true
        System.out.println(canConstruct("ab", "aaaaaabbbbbb")); // true
        System.out.println(canConstruct("aa", "aab")); // true
        System.out.println(canConstruct("aaabbbcccee", "aaabbbzzdef")); // false

    }
}
